import React from "react";
import { Affix } from "antd";

const Nav = () => {
  return (
    <Affix>
      <div style={{ backgroundColor: "gray" }}>
        <Link to='/'>통과했수</Link>
        <nav style={{ borderBottom: "solid 1px", paddingBottom: "1rem" }}>
          <h2>nav</h2>
          <h3>nav</h3>
        </nav>
      </div>
    </Affix>
  );
};

export default Nav;
